import React, { useState } from 'react';
import { motion } from 'framer-motion';

function RegisterPage() {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [phone, setPhone] = useState('');

  const inputVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { opacity: 1, y: 0, transition: { duration: 0.8 } },
  };

  return (
    <div className="bg-purple-100 p-6 rounded-lg shadow-md max-w-md mx-auto mt-10">
      <h1 className="text-2xl font-bold mb-4 text-purple-900">Register Page</h1>
      <motion.div initial="hidden" animate="visible" variants={inputVariants} className="mb-4">
        <input
          type="text"
          placeholder="Username"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
          className="w-full p-2 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
        />
      </motion.div>
      <motion.div initial="hidden" animate="visible" variants={inputVariants} className="mb-4">
        <input
          type="email"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          className="w-full p-2 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
        />
      </motion.div>
      <motion.div initial="hidden" animate="visible" variants={inputVariants} className="mb-4">
        <input
          type="password"
          placeholder="Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          className="w-full p-2 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
        />
      </motion.div>
      <motion.div initial="hidden" animate="visible" variants={inputVariants} className="mb-4">
        <input
          type="text"
          placeholder="Phone"
          value={phone}
          onChange={(e) => setPhone(e.target.value)}
          className="w-full p-2 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
        />
      </motion.div>
    </div>
  );
}

export default RegisterPage;
